func removeUnconfidentResult(r []evaluate.Result) []evaluate.Result {
	a := []evaluate.Result{}
	for _, v := range r {
		if v.Confidence > 0 {
			a = append(a, v)
		}
	}
	return a
}

func evaluatePastItems(t *testing.T, body string, lastTime string) []evaluate.Result {
	baseTime, err := time.Parse(time.RFC3339, lastTime)
	if err != nil {
		t.Fatalf("Time parse error: %v", err)
	}
	epspRecords := []epsp.Record{}
	err = json.Unmarshal([]byte(body), &epspRecords)
	if err != nil {
		t.Fatalf("JSON unmarshal error: %v from %v", err, string(body))
	}
	replaceTime(&epspRecords, freezeTime, baseTime)
	return aggregateAndEvaluate(epspRecords)
}

func replaceTime(r *[]epsp.Record, f time.Time, t time.Time) {
	d := f.Sub(t)

	for i := 0; i < len(*r); i++ {
		v := &(*r)[i]
		t := v.Time.Time.Add(d)
		v.Time.Time = &t
		if v.Code == 555 {
			t = v.Areapeers.Time.Time.Add(d)
			v.Areapeers.Time.Time = &t
		}
		if v.Code == 561 {
			t = v.Userquake.Time.Time.Add(d)
			v.Userquake.Time.Time = &t
		}
	}
}
